import React from 'react';
import './transaccion.css';

function Transaccion(props){
	return (
		<div className="transaccion">
			<div className="textotransaccion">
				C&oacute;digo:
			</div>
			<div className="valortranzaccion">
				{props.codigo}
			</div>
			<div className="textotransaccion">
				Grupo:
			</div>
			<div className="valortranzaccion">
				{props.grupo}
			</div>
			<div className="textotransaccion">
				Descripci&oacute;n:
			</div>
			<div className="valortranzaccion">
				{props.descripcion}
			</div>
		</div>
		);
}

export {Transaccion};
